import styled from 'styled-components';
import { useTheme } from '@geist-ui/react';
const { palette } = useTheme();
export const NavBar = styled.nav`
  height: 72px;
  width: 100%;
  max-width: 1160px;
  margin: 0 auto;
  display: flex;
  justify-content: space-between;

  background: palette.successLight;

  align-items: center;
  .navbar-items {
    display: flex;
  }
`;
